import React from 'react';
import '../styles/kboPage.css';
import Slider from "react-slick"; 

const KboPage = () => {

  return (
    <div className="about-container">
      <h1>순위</h1>
      <div className="player-record-container">
      <button>팀 순위</button>
      <button>선수 순위</button>
      </div>
      <h1>기록</h1>
      <div className="player-record">
      <li>팀 기록</li>
      <li>선수 기록</li>
     </div>
   </div>
  );
};

export default KboPage;
